import React from 'react';

const About = () => {
  return (
    <section id="about">
      <h2>About Me</h2>
      <p>
        Hello! I'm Meet Sutariya, a passionate student currently studying at Loyalist College in Toronto, pursuing a Bachelor's degree in Computer Software and Database Development. 
        With a keen interest in software engineering, I have developed skills in Java, PHP, HTML, CSS, and JavaScript, along with a deep understanding of database management and development.

        I'm constantly learning new technologies, tackling challenging projects, and refining my problem-solving abilities. My goal is to continue growing as a full-stack developer and contribute to innovative solutions in the tech industry.
      </p>
    </section>
  );
};

export default About;
